import Logo from "./Components/Image/logo.png";

function App() {
  return (
    <>
      <div className="container">
        <div className="row">
          <div className="logo">
            <img src={Logo} alt="Logo" />
          </div>
          {/* form  */}
          <div className="form">
            <form action="">
            </form>
          </div>
        </div>
      </div>
    </>
  );
}

export default App;
